import React from "react";
import HighlightIcon from "@material-ui/icons/Highlight";
import { Navbar, Nav } from "react-bootstrap";


function Header (){

    return (
        // <header>
        //   <h1>
        //     <HighlightIcon />
        //     Michael Powell
        //   </h1>
        // </header>

      <Navbar>
        <Navbar.Brand>
          <Link to="/" className="navbar-brand">
            Scratch
          </Link>
        </Navbar.Brand>
        <Nav>
          <Nav.Item>
            <Link to="/lookup" className="nav-link">
              Lookup
            </Link>
          </Nav.Item>
          <Nav.Item>
            <Link to="/list" className="nav-link">
              List
            </Link>
          </Nav.Item>
        </Nav>
      </Navbar>
      );
}

export default Header;
